import logo from './logo.svg';
import './App.css';
import data from './original_data';
import Movie from './components/Movie'

function App() {
  const movies = data;
  return (
    <div className="App">
      {movies.map(movie => <Movie 
      title={movie.title} 
      event={movie.event}
      takes_place={movie.takes_place}
      theatre={movie.theatre}
      length={movie.length}
      audio={movie.audio}
      awards={movie.awards}
      availability={movie.availability}
      ></Movie>)}
    </div>
  );
}

export default App;
